-- ----------------------------
-- Table structure for base_admin
-- ----------------------------
DROP TABLE IF EXISTS `base_admin`;
CREATE TABLE `base_admin`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `username` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '登陆账号',
  `password` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '登陆密码',
  `truename` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '真实姓名',
  `role_id` int(10) UNSIGNED NOT NULL COMMENT '角色id',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态。1启用0停用',
  `isdel` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `logintime` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登陆时间',
  `token` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '登陆标识',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '操作人员id',
  `card_number` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '身份证号码',
  `phone` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '手机号码',
  `sex` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '性别  1男0女',
  `createtime` int(10) UNSIGNED NOT NULL COMMENT '创建时间',
  `updatetime` int(10) UNSIGNED NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_admin_username_index`(`username`) USING BTREE,
  INDEX `base_admin_truename_index`(`truename`) USING BTREE,
  INDEX `base_admin_role_id_index`(`role_id`) USING BTREE,
  INDEX `base_admin_status_index`(`status`) USING BTREE,
  INDEX `base_admin_isdel_index`(`isdel`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of base_admin
-- ----------------------------

