  INDEX `base_dictionary_right_index`(`right`) USING BTREE,
  INDEX `base_dictionary_pid_index`(`pid`) USING BTREE,
  INDEX `base_dictionary_status_index`(`status`) USING BTREE,
  INDEX `base_dictionary_isdel_index`(`isdel`) USING BTREE
