-- ----------------------------
-- Table structure for base_log
-- ----------------------------
DROP TABLE IF EXISTS `base_log`;
CREATE TABLE `base_log`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `module_title` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '模块标识',
  `operate_title` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '操作标识',
  `type` varchar(16) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '日志类型。logout登出 login登陆 add新增  update 修改 del 删除 ',
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '操作内容',
  `parameters` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '参数信息',
  `result` int(11) NULL DEFAULT 1 COMMENT '结果  1 成功  0：失败',
  `author_id` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '操作人员id',
  `author_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '操作人员账号',
  `ip` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT 'ip地址',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_log_module_index`(`module_title`) USING BTREE,
  INDEX `base_log_operate_index`(`operate_title`) USING BTREE,
  INDEX `base_log_result_index`(`result`) USING BTREE,
  INDEX `base_log_author_id_index`(`author_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5733 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of base_log
-- ----------------------------

