  `tmp` int(10) UNSIGNED NOT NULL COMMENT '标记状态。用户更新节点数据',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '操作人员id',
  `createtime` int(10) UNSIGNED NOT NULL COMMENT '创建时间',
  `updatetime` int(10) UNSIGNED NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_module_left_index`(`left`) USING BTREE,
  INDEX `base_module_right_index`(`right`) USING BTREE,
  INDEX `base_module_pid_index`(`pid`) USING BTREE,
  INDEX `base_module_deep_index`(`deep`) USING BTREE,
  INDEX `base_module_status_index`(`status`) USING BTREE,
  INDEX `base_module_isdel_index`(`isdel`) USING BTREE,
  INDEX `base_module_tmp_index`(`tmp`) USING BTREE,
  INDEX `base_module_module_index`(`module`) USING BTREE,
  INDEX `base_module_type_index`(`type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 62 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Compact;

