-- ----------------------------
-- Table structure for order_app
-- ----------------------------
DROP TABLE IF EXISTS `order_app`;
CREATE TABLE `order_app`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单编号',
  `user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户ID',
  `user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户姓名',
  `phone` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电话号码',
  `community` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务社区',
  `address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '安装地址',
  `device` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '智能看护设备',
  `device_unit_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '智能看护设备单价',
  `device_num` int(11) NULL DEFAULT NULL COMMENT '智能看护设备数量',
  `device_money` decimal(11, 2) NULL DEFAULT NULL COMMENT '原价（灰色的是原价）',
  `device_discount` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣价',
  `route` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '4G路由器',
  `route_unit_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '4G路由器单价',
  `route_num` int(11) NULL DEFAULT NULL COMMENT '4G路由器数量',
  `route_money` decimal(11, 2) NULL DEFAULT NULL COMMENT '原价（灰色的是原价）',
  `route_discount` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣价',
  `data_charges` decimal(11, 2) NULL DEFAULT NULL COMMENT '4G数据月费（灰色）',
  `data_discount` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣价（4G数据月费）',
  `data_discount_rate` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣率（4G数据月费）',
  `data_charge_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收费类型：1按月、2按年',
  `basic_charges` decimal(11, 2) NULL DEFAULT NULL COMMENT '基本服务费(灰色)',
  `basic_discount` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣价（基本服务费）',
  `basic_discount_rate` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣率（基本服务费）',
  `basic_charge_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收费类型：1按月 2按年',
  `increment_charges` decimal(11, 2) NULL DEFAULT NULL COMMENT '增值服务费（灰色）',
  `increment_discount` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣价（增值服务费）',
  `increment_discount_rate` decimal(11, 2) NULL DEFAULT NULL COMMENT '折扣率（增值服务费）',
  `increment_charge_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '增值服务收费类型',
  `total_price` decimal(11, 2) NULL DEFAULT NULL COMMENT '总价',
  `service_plan` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务方案',
  `pay_type` int(11) NULL DEFAULT NULL COMMENT '支付方式：1.微信   2.支付宝   3.银联   4.线下',
  `order_status` int(1) NULL DEFAULT NULL COMMENT '订单状态   1：待付款  2：已付款  3：已取消  4：已安装  5：活跃  6：休眠  7：已拆除  8：待续费   9：准备中的订单  10:已绑定（此状态仅用于平板端）',
  `renewal_amount` decimal(11, 2) NULL DEFAULT NULL COMMENT '续费总金额',
  `is_del` int(10) NOT NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `partner_id` varchar(130) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '分销商编号',
  `partner_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '分销商简称',
  `area_id` int(10) NULL DEFAULT NULL COMMENT '省id',
  `acreage` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房屋面积',
  `region_id` int(11) NULL DEFAULT NULL COMMENT '区id',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  `address_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 187 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户订单表' ROW_FORMAT = Compact;

