-- ----------------------------
-- Table structure for renewal_order
-- ----------------------------
DROP TABLE IF EXISTS `renewal_order`;
CREATE TABLE `renewal_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '续费订单编号',
  `user_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户id',
  `address_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址编号',
  `data_charges` decimal(10, 0) NULL DEFAULT NULL COMMENT '4G数据月费（灰色）',
  `data_discount` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣价（4G数据月费）',
  `data_discount_rate` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣率（4G数据月费）',
  `data_charge_type` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收费类型：1按月、2按年',
  `basic_charges` decimal(10, 0) NULL DEFAULT NULL COMMENT '基本服务费(灰色)',
  `basic_discount` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣价（基本服务费）',
  `basic_discount_rate` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣率（基本服务费）',
  `basic_charge_type` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收费类型：1按月 2按年',
  `increment_charges` decimal(10, 0) NULL DEFAULT NULL COMMENT '增值服务费（灰色）',
  `increment_discount` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣价（增值服务费）',
  `increment_discount_rate` decimal(10, 0) NULL DEFAULT NULL COMMENT '折扣率（增值服务费）',
  `increment_charge_type` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '增值服务收费类型: 1按月 2按年',
  `amount` decimal(10, 0) NULL DEFAULT NULL COMMENT '续费总金额',
  `service_type` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务类型集：1：基本服务 2：增值服务 3:4G数据服务',
  `pay_type` int(10) NULL DEFAULT NULL COMMENT '支付方式：1.微信   2.支付宝   3.银联   4.线下',
  `state` int(10) NULL DEFAULT 1 COMMENT '状态：1：待付款  2：已付款',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间（续费时间）',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 27 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '服务续费订单表' ROW_FORMAT = Compact;

