  `charge_area` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '/' COMMENT '负责片区',
  `partner_address` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '/' COMMENT '合作商地址',
