  `region_id` int(30) NULL DEFAULT NULL,
  `area` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '所在地区',
  `street` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '街道地址',
  `is_default` int(11) NULL DEFAULT 0 COMMENT '默认地址：1是  0否',
  `label` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址标签 比如 ：爷爷家、家',
  `type` int(10) NULL DEFAULT 0 COMMENT '类型 ： 0：用户地址。1：机构地址',
  `is_del` int(10) NOT NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 265 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '用户地址管理表' ROW_FORMAT = Compact;

