  `user_key` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '(只有安装人员账号才有值)',
  `is_del` tinyint(3) NOT NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `status` tinyint(3) NOT NULL DEFAULT 1 COMMENT '状态。1启用0停用',
