-- ----------------------------
-- Table structure for t_alarm
-- ----------------------------
DROP TABLE IF EXISTS `t_alarm`;
CREATE TABLE `t_alarm`  (
  `id` bigint(10) NOT NULL AUTO_INCREMENT,
  `number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警编号：系统后台自动生成',
  `type` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警类型',
  `jrank` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警级别',
  `rule` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警规则',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '提示内容',
  `state` int(10) NULL DEFAULT 1 COMMENT '是否启用： 1是 0否',
  `is_del` int(10) NOT NULL DEFAULT 0 COMMENT '是否删除： 1是 0否',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '报警基础信息表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_alarm
-- ----------------------------

-- ----------------------------
-- Table structure for t_alarm_details
-- ----------------------------
DROP TABLE IF EXISTS `t_alarm_details`;
CREATE TABLE `t_alarm_details`  (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户id',
  `number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警编号',
  `type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警类型',
  `jrank` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警级别',
  `warning_level` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '警报（0：姿态绿色警报，1：姿态黄色警报，2：姿态红色警报，3：呼吸过低黄色警报，3：呼吸过低黄色警报，5：呼吸过低红色警报，6：呼吸过高红色警报，7：心跳过低黄色警报，8：心跳过高黄色警报，9：心跳过低红色警报，10：心跳过低高色警报，11:  目标消失过久黄色警报，12:  目标消失过久红色警报）',
  `breath_rate` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '呼吸频率  单位为：次/分钟  ，  -1：没有检测到（在0.5小时内没测到）',
  `heart_rate` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '心跳频率  单位为：次/分钟，-1：没有检测到',
  `pose` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '姿态  0：站 1：坐  2：躺',
  `pose_duration` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '姿态持续时间，单位为秒',
  `pose_roi_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所在活动区域, 例如： sofa, door',
  `pose_roi_order` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '虽在第几个活动区域， 例如1表明第一个(pose_roi_name)',
  `gone_roi_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '目标消失区域,例如: Toilet, Bedroom',
  `gone_roi_order` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '目标消失在第几个区域,例如bedroom1表明卧室1',
  `gone_duration` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '目标消失持续时间，单位为秒',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '报警内容',
  `serial_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备序列号',
  `bound_room` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备绑定房间（一期的字段，二期不用管）',
  `staff_id` int(11) NULL DEFAULT NULL COMMENT '员工id',
  `staff_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '派遣员工的姓名',
  `alarm_time` datetime(0) NULL DEFAULT NULL COMMENT '报警时间',
  `location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备所在地',
  `relieve_cause` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '解除原因',
  `dissolve_people` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '解除人',
  `Relieve_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '解除日期',
  `state` int(10) NULL DEFAULT 0 COMMENT '解决状态：1已解决 0未解决',
  `is_del` int(10) NOT NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '报警详情表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_alarm_details
-- ----------------------------

