  `sit_duration` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '坐姿时间， 单位秒',
  `activity_duration` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '活动时间， 单位秒',
  `heart_rate_max` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '最大心跳， 单位次每秒',
  `heart_rate_mid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '心率中间值， 单位次每秒',
  `heart_rate_min` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '最低心率， 单位次每秒',
  `breath_rate_max` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '最大呼吸， 单位次每秒',
  `breath_rate_mid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '呼吸中间值， 单位次每秒',
  `breath_rate_min` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '最低呼吸， 单位次每秒',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除：1是  0否',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '日报姿态表（对应硬件接口)' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_daily
-- ----------------------------

-- ----------------------------
-- Table structure for t_device
-- ----------------------------
DROP TABLE IF EXISTS `t_device`;
CREATE TABLE `t_device`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '设备id',
  `device_no` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备编号',
  `serial_number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设备序列号： 唯一标识',
  `model_type` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '型号',
  `exception_time` datetime(0) NULL DEFAULT NULL COMMENT '异常时间',
  `firmware_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件版本号',
  `binding_room` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备绑定房间',
  `img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图片(设备拍照后保存在服务器的地址)',
  `image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '最新标识的图片',
  `initial` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '初步标识数据（把所有数据都用这个字段保存）',
  `again` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '二次标识数据（把所有数据都用这个字段保存）',
  `number_of_people` int(11) NULL DEFAULT NULL COMMENT '图片中的人数',
  `code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '短信验证码（授权时，发送短信，保存）',
  `state` int(10) NULL DEFAULT NULL COMMENT '状态：1：未连接  2：已安装 3：未安装 4：已开通 5：已绑定   6：活跃  7：休眠   8:移位 9:报废 10.拆除  11：故障',
  `partner_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属分销商编号',
  `cooperative` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属分销商',
  `area` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属片区（废弃）',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除： 1是 0否',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间（安装时间：完成图片初步标识时设置进去）',
  `run_time` datetime(0) NULL DEFAULT NULL COMMENT '运营时间',
  `sleep_time` datetime(0) NULL DEFAULT NULL COMMENT '休眠时间',
  `fault_time` datetime(0) NULL DEFAULT NULL COMMENT '故障时间',
  `user_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户ID',
  `user_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户名称',
  `user_phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户联系方式',
  `order_no` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
  `unit_id` int(11) NULL DEFAULT NULL COMMENT '单元id',
  `unregistered` datetime(0) NULL DEFAULT NULL COMMENT '注册时间',
  `settling_time` datetime(0) NULL DEFAULT NULL COMMENT '绑定时间',
  `untying_time` datetime(0) NULL DEFAULT NULL COMMENT '解绑时间',
  `installer_id` bigint(20) NULL DEFAULT NULL COMMENT '安装人员id',
  `operator_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人姓名',
  `operator_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人ID',
  `is_bad` int(10) NULL DEFAULT 0 COMMENT '是否故障 ：1 是  0否',
  `identif_state` int(10) NULL DEFAULT NULL COMMENT '标识状态：1：标识异常 2：已确认异常 3：图片已授权 4：已标识',
  `display` int(10) NULL DEFAULT 0 COMMENT '此字段仅用于平板端点击保存，app端安装单元：检测图片弹框消失，回到设备详情页',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `serial_number`(`serial_number`) USING BTREE,
  INDEX `equipment_state_index`(`state`) USING BTREE,
  INDEX `equipment_batch_number_index`(`device_no`) USING BTREE,
  INDEX `equipment_serial_number_index`(`serial_number`) USING BTREE,
  INDEX `equipment_is_del_index`(`is_del`) USING BTREE,
  INDEX `equipment_create_time_index`(`create_time`) USING BTREE,
  INDEX `equipment_run_time_index`(`run_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 114 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '设备表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_device
