-- ----------------------------
-- Table structure for t_device_price
-- ----------------------------
DROP TABLE IF EXISTS `t_device_price`;
CREATE TABLE `t_device_price`  (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `device_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备名称字典码',
  `device_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备名称',
  `area_code` int(50) NULL DEFAULT NULL COMMENT '区域id',
  `area_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '区域名称',
  `charge_code` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收费类型字典码',
  `charge_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收费类型名称',
  `price` decimal(10, 2) NULL DEFAULT NULL COMMENT '市场价',
  `discount` decimal(10, 2) NULL DEFAULT NULL COMMENT '折扣',
  `sale_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '销售价',
  `state` int(11) NULL DEFAULT NULL COMMENT '状态：1用户购买了4G路由器   0用户没有买',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '设备价格表' ROW_FORMAT = Compact;

