-- ----------------------------
-- Table structure for t_dictionary
-- ----------------------------
DROP TABLE IF EXISTS `t_dictionary`;
CREATE TABLE `t_dictionary`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '名称',
  `pid` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '节点父级id',
  `p_key` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '父级标题',
  `status` tinyint(3) UNSIGNED NULL DEFAULT 1 COMMENT '状态。1启用0停用',
  `is_del` tinyint(3) UNSIGNED NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `author_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `my_key` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '值 :对应的标识',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_dictionary_pid_index`(`pid`) USING BTREE,
  INDEX `base_dictionary_status_index`(`status`) USING BTREE,
  INDEX `base_dictionary_isdel_index`(`is_del`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 103 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci COMMENT = '数据字典表' ROW_FORMAT = Compact;

