-- ----------------------------
-- Table structure for t_firmware
-- ----------------------------
DROP TABLE IF EXISTS `t_firmware`;
CREATE TABLE `t_firmware`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件名称',
  `firmware_no` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件版本号',
  `scope` int(10) NULL DEFAULT NULL COMMENT '使用范围： 1 看护设备  0用户APP',
  `state` int(10) NULL DEFAULT NULL COMMENT '固件状态：1开启 0关闭',
  `file_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '原文件名',
  `accessory` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件附件地址',
  `remind` int(10) NULL DEFAULT 1 COMMENT '固件升级提醒：1开启 0关闭',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件描述',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除：1 是 0 否',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 44 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '固件管理表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_firmware
-- ----------------------------

-- ----------------------------
-- Table structure for t_hardware_alarm_information
-- ----------------------------
DROP TABLE IF EXISTS `t_hardware_alarm_information`;
CREATE TABLE `t_hardware_alarm_information`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `machine_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下位机唯一标识',
  `status` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '0：设备正常 1：设备故障',
  `warning_level` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '0：姿态绿色警报1：姿态黄色警报2：姿态红色警报3：呼吸过低黄色警报4：呼吸过高黄色警报5：呼吸过低红色警报6：呼吸过高红色警报7：心跳过低黄色警报8：心跳过高黄色警报9：心跳过低红色警报10：心跳过低高色警报11:  目标消失过久黄色警报12:  目标消失过久红色警报',
  `warning_time` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '警报发生时间',
  `breath_rate` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '呼吸频率单位为：次/分钟 -1：没有检测到（在0.5小时内没测到）',
  `heart_rate` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '心跳频率单位为：次/分钟 -1：没有检测到',
  `pose` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '姿态0：站1：坐2：躺',
  `pose_duration` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '姿态持续时间，单位为秒',
  `pose_roi_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '所在活动区域, 例如： sofa, door',
  `pose_roi_order` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '虽在第几个活动区域， 例如1表明第一个(pose_roi_name)',
  `gone_roi_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '目标消失区域,例如: Toilet, Bedroom',
  `gone_roi_order` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '目标消失在第几个区域,例如bedroom1表明卧室1',
  `gone_duration` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '目标消失持续时间，单位为秒',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '硬件消息报警管理表' ROW_FORMAT = Compact;

