-- ----------------------------
-- Table structure for t_maintain_order
-- ----------------------------
DROP TABLE IF EXISTS `t_maintain_order`;
CREATE TABLE `t_maintain_order`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '姓名',
  `phone` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '手机号码',
  `order_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
  `location_id` bigint(20) NULL DEFAULT NULL COMMENT '设备地址表id',
  `binding_room` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '绑定房间',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '安装地址',
  `serial_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备序列号',
  `model_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备型号',
  `firmware_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件版本',
  `unit_id` bigint(20) NULL DEFAULT NULL COMMENT '单元id',
  `distributor_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单所属分销编号',
  `user_org_order_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户机构订单编号（点击确认维修时，设置值）',
  `cause` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '故障原因',
  `state` int(10) NULL DEFAULT 7 COMMENT '状态：1：待维修  2：已关闭  3：已安装  4：活跃  5：待付款  6：已付款 7：待确认',
  `replace_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '替换设备价格',
  `service_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '上门维修服务费',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '付款时间',
  `pay_type` int(10) NULL DEFAULT NULL COMMENT '支付方式：1.微信   2.支付宝   3.银联   4.线下',
  `type` int(10) NULL DEFAULT 0 COMMENT '类型：0：用户  1：机构',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `pay_state` int(10) NULL DEFAULT NULL COMMENT '是否已付费 ：  1是  默认 0：否',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '维修订单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_maintain_order
-- ----------------------------

-- ----------------------------
-- Table structure for t_malfunction
-- ----------------------------
DROP TABLE IF EXISTS `t_malfunction`;
CREATE TABLE `t_malfunction`  (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `batch_number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备批次号',
  `serial_number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备序列号',
  `model_type` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '型号',
  `firmware_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固件版本号',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '故障描述/故障信息',
  `site` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设备安装地址',
  `binding_room` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '绑定房间',
  `staff_id` bigint(20) NULL DEFAULT NULL COMMENT '派遣员工id',
  `staff_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '派遣员工姓名',
  `dispose_content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '处理内容',
  `is_del` int(10) NULL DEFAULT 0 COMMENT '是否删除： 1是 0否',
  `state` int(10) NULL DEFAULT 0 COMMENT '维修状态： 1已解决  0未解决 ',
  `author_id` int(20) NULL DEFAULT NULL COMMENT '操作人员id',
  `run_time` datetime(0) NULL DEFAULT NULL COMMENT '运营时间',
  `facility_time` datetime(0) NULL DEFAULT NULL COMMENT '获取设备的导入系统时创建时间',
  `handle_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '处理时间',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间(故障时间)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '故障信息表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_malfunction
-- ----------------------------

-- ----------------------------
-- Table structure for t_message
-- ----------------------------
DROP TABLE IF EXISTS `t_message`;
CREATE TABLE `t_message`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息名称',
  `promulgator` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发布者',
  `type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息类型',
  `type_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '消息类型字典码',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '详细内容',
  `recipient` int(11) NULL DEFAULT NULL COMMENT '通知接收人: 1：全部用户 2：APP用户 3：后台人员  4：合作商  5：安装人员 6 : 社区人员  7：机构用户 8：暂不发布',
  `state` int(11) NULL DEFAULT 0 COMMENT '状态：1已发布 0未发布',
  `is_del` int(11) NULL DEFAULT 0 COMMENT '是否删除：1是 0否',
  `author_id` int(11) NULL DEFAULT NULL COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `push_time` datetime(0) NULL DEFAULT NULL COMMENT '发布时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 23 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '消息管理表' ROW_FORMAT = Compact;

