-- ----------------------------
-- Table structure for t_new_authority
-- ----------------------------
DROP TABLE IF EXISTS `t_new_authority`;
CREATE TABLE `t_new_authority`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `role_id` int(10) UNSIGNED NOT NULL COMMENT '角色id',
  `module_id` int(10) UNSIGNED NOT NULL COMMENT '模块id',
  `operate_ids` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '操作id集',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `base_authority_role_id_module_id_unique`(`role_id`, `module_id`) USING BTREE,
  INDEX `base_authority_role_id_index`(`role_id`) USING BTREE,
  INDEX `base_authority_module_id_index`(`module_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '角色权限表' ROW_FORMAT = Compact;

