-- ----------------------------
-- Table structure for t_new_module
-- ----------------------------
DROP TABLE IF EXISTS `t_new_module`;
CREATE TABLE `t_new_module`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `terrace_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '平台类型,1:分销商 2:社区服务支持，3:机构用户,（公共模块：1,2,3）',
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `icon` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '图标',
  `module` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '模块标识',
  `link` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '外部模块的链接地址',
  `type` enum('out','inner') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'inner' COMMENT '类型。inner内部 out外部',
  `left` int(10) UNSIGNED NOT NULL COMMENT '节点左值',
  `right` int(10) UNSIGNED NOT NULL COMMENT '节点右值',
  `pid` int(10) UNSIGNED NOT NULL COMMENT '节点父级id',
  `deep` int(10) UNSIGNED NOT NULL COMMENT '节点层级',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态。1启用0停用',
  `isdel` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `tmp` int(10) UNSIGNED NOT NULL COMMENT '标记状态。用户更新节点数据',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_module_left_index`(`left`) USING BTREE,
  INDEX `base_module_right_index`(`right`) USING BTREE,
  INDEX `base_module_pid_index`(`pid`) USING BTREE,
  INDEX `base_module_deep_index`(`deep`) USING BTREE,
  INDEX `base_module_status_index`(`status`) USING BTREE,
  INDEX `base_module_isdel_index`(`isdel`) USING BTREE,
  INDEX `base_module_tmp_index`(`tmp`) USING BTREE,
  INDEX `base_module_module_index`(`module`) USING BTREE,
  INDEX `base_module_type_index`(`type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 45 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '新后台模块表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_new_module
-- ----------------------------

-- ----------------------------
-- Table structure for t_new_operate
-- ----------------------------
