CREATE TABLE `t_new_operate`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `module` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '模块标识',
  `operate` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '操作标识',
  `plus` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '附加操作标识',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态。1启用0停用',
  `isdel` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `base_operate_status_index`(`status`) USING BTREE,
  INDEX `base_operate_isdel_index`(`isdel`) USING BTREE,
  INDEX `base_operate_module_index`(`module`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 93 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '新后台模块操作表' ROW_FORMAT = Compact;

