DROP TABLE IF EXISTS `t_new_role`;
CREATE TABLE `t_new_role`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `type` int(10) NULL DEFAULT NULL COMMENT ' 1：分销商  2：社区服务支持  3：机构用户  ',
