  `left` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '节点左值',
  `right` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '节点右值',
  `pid` int(10) UNSIGNED NOT NULL COMMENT '节点父级id',
  `nature` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '角色性质',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态。1启用0停用',
  `isdel` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除。1是0否',
  `author_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '操作人员id',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
