  INDEX `base_role_isdel_index`(`isdel`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '新后台角色信息表（分销商，社区，机构用户）' ROW_FORMAT = Compact;

