-- ----------------------------
-- Table structure for t_order
-- ----------------------------
DROP TABLE IF EXISTS `t_order`;
CREATE TABLE `t_order`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
  `order_status` int(1) NULL DEFAULT NULL COMMENT '订单状态   1：待付款  2：已付款  3：已取消  4：已安装  5：活跃  6：休眠  7：已拆除',
  `pay_money` decimal(10, 0) NULL DEFAULT NULL COMMENT '付款金额',
  `pay_type` int(1) NULL DEFAULT NULL COMMENT '1:线下  2：微信支付  3：支付宝 4：银联',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付时间',
  `user_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户ID',
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户姓名',
  `user_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户手机',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '下单时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '状态时间：休眠时间、拆除时间',
  `is_del` int(11) NULL DEFAULT 0 COMMENT '是否删除： 1是 0否',
  `cause` varchar(0) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '取消原因 （取消订单 状态为已取消时才显示）',
  `explains` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '补充说明（取消订单  状态为已取消时显示）',
  `author_id` int(11) NULL DEFAULT NULL COMMENT '获取当前登录人的id',
  `author_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人姓名（只有状态为休眠和拆除才显示）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表(废弃)' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of t_order
