-- ----------------------------
-- Table structure for user_location
-- ----------------------------
DROP TABLE IF EXISTS `user_location`;
CREATE TABLE `user_location`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户地址表',
  `user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户id',
  `address_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址编号',
  `num` int(11) NULL DEFAULT 0 COMMENT '设备数量',
  `house_type` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房子类型',
  `basic_time` datetime(0) NULL DEFAULT NULL COMMENT '基本服务开始时间',
  `increment_time` datetime(0) NULL DEFAULT NULL COMMENT '增值服务开始时间',
  `data_time` datetime(0) NULL DEFAULT NULL COMMENT '4G数据服务开始时间',
